// frontend/src/pages/admin/Students.jsx
import React, { useEffect, useState } from "react";
import Sidebar from "../../components/Sidebar";
import Header from "../../components/Header";
import api from "../../api/api";

export default function Students() {
  const [students, setStudents] = useState([]);
  const [form, setForm] = useState({
    fullName: "",
    username: "",
    password: "",
    studentCode: "",
    className: "",
    major: "",
    email: "",
  });

  const loadStudents = () => {
    api
      .get("/students")
      .then((res) => setStudents(res.data))
      .catch((err) => console.error(err));
  };

  useEffect(() => {
    loadStudents();
  }, []);

  const handleChange = (e) => {
    setForm({ ...form, [e.target.name]: e.target.value });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      await api.post("/students", form);
      alert("T·∫°o sinh vi√™n th√†nh c√¥ng");
      setForm({
        fullName: "",
        username: "",
        password: "",
        studentCode: "",
        className: "",
        major: "",
        email: "",
      });
      loadStudents();
    } catch (err) {
      alert(err.response?.data?.message || "T·∫°o sinh vi√™n th·∫•t b·∫°i");
    }
  };

  return (
    <div className="admin-container">
      <Sidebar />
      <Header />
      <main className="admin-main">
        <h2>üéì Qu·∫£n l√Ω sinh vi√™n</h2>

        <form onSubmit={handleSubmit} style={{ margin: "20px 0" }}>
          <div>
            <label>H·ªç t√™n</label>
            <input
              name="fullName"
              value={form.fullName}
              onChange={handleChange}
              required
            />
          </div>
          <div>
            <label>T√™n ƒëƒÉng nh·∫≠p</label>
            <input
              name="username"
              value={form.username}
              onChange={handleChange}
              required
            />
          </div>
          <div>
            <label>M·∫≠t kh·∫©u</label>
            <input
              name="password"
              type="password"
              value={form.password}
              onChange={handleChange}
              required
            />
          </div>
          <div>
            <label>M√£ sinh vi√™n</label>
            <input
              name="studentCode"
              value={form.studentCode}
              onChange={handleChange}
              required
            />
          </div>
          <div>
            <label>L·ªõp</label>
            <input
              name="className"
              value={form.className}
              onChange={handleChange}
            />
          </div>
          <div>
            <label>Ng√†nh</label>
            <input
              name="major"
              value={form.major}
              onChange={handleChange}
            />
          </div>
          <div>
            <label>Email</label>
            <input
              name="email"
              type="email"
              value={form.email}
              onChange={handleChange}
            />
          </div>
          <button type="submit" className="btn-login" style={{ marginTop: 10 }}>
            T·∫°o sinh vi√™n
          </button>
        </form>

        <h3>Danh s√°ch sinh vi√™n</h3>
        <table>
          <thead>
            <tr>
              <th>M√£ SV</th>
              <th>H·ªç t√™n</th>
              <th>T√™n ƒëƒÉng nh·∫≠p</th>
              <th>L·ªõp</th>
              <th>Ng√†nh</th>
              <th>Email</th>
            </tr>
          </thead>
          <tbody>
            {students.map((s) => (
              <tr key={s._id}>
                <td>{s.studentCode}</td>
                <td>{s.userId?.fullName}</td>
                <td>{s.userId?.username}</td>
                <td>{s.className}</td>
                <td>{s.major}</td>
                <td>{s.email}</td>
              </tr>
            ))}
          </tbody>
        </table>
      </main>
    </div>
  );
}
